Let's create a new project and compare it with the Hello World example in previous chapter. To create a project you should create a directory for your project : $ mkdir hello_world_2
$ cd hello_world_2 Now we create a new project with following command : $ hascal init After running above command, you’ll see Hascal has generated two files and one directory for us: a config.json file, a .gitignore file and a src directory with a app.has file inside. config.json : { "filename": "src/app.has", "outfile": "build/app", } The filename field contains your main file that contains your entry function(main) and outfile field is output path of excutable file. src/app.has : function main():int{ print("Hello World!") return 0
} The generated Hascal file contains Hello World! program, you can edit it.

