Functions are a way to group code that can be called to perform a specific task. You can declare a function using the function keyword: function foo() { print("Hello World")
} Also your function block should be outside of a function. Your function can have parameters and return a value. You can declare parameters and return type, like variable declarations: function add(x:int,y:int): int { return x + y
} In the example above, x and y are parameters and thire type(int) is your return type. Note: you can use ? to make a parameter nullable.

