For creating a module, you can create a file with the same name as the module and with the extension .has and put the module code inside it: add.has: function add(x:int, y:int) : int { return x + y
} main.has: use add function main() : int { print(add(1,2)) return 0
} Creating foldered modules Module files can be placed in a folder, for creating a foldered module you should first create the folder and then create the _.has file inside it. The _.has file is the main file of the module and compiler will look for it. You can also import submodules in _.has file. Note: Any submodule that is not imported in _.has file will be ignored. Note: Any submodule can have other submodules.

